int is_cp949(char *str)
{
	unsigned char *ptu = (unsigned char *) str;

	return ptu[0] > 128 && ptu[0] < 255 && ptu[1] > 64 && ptu[1] < 255;
}

int utf8_to_cp949(char *input, char *output)
{
	char *pti, *pto;
	int size, index, result;

	pti = input;
	pto = output;

	while (*pti)
	{
		size = get_utf8_index(pti, &index);

		if (size > 1)
		{
			if (index >= 44032 && index <= 55203)
			{
				result = unicode_to_cp949_vals[index - 44032];

				*pto++ = result / 256;
				*pto++ = result % 256;
			}
			else
			{
				tintin_printf(gtd->ses, "<118>utf8_to_cp949: did not find unicode index '0x%04x'", index);

				*pto++ = '?';
				*pto++ = '?';
			}
			pti += size;
		}
		else
		{
			*pto++ = *pti++;
		}
	}
	*pto = 0;

	return pto - output;
}

int cp949_to_utf8(char *input, char *output)
{
	unsigned char *pti, *pto;
	int index, val;

	pti = (unsigned char *) input;
	pto = (unsigned char *) output;

	while (*pti)
	{
		if (is_cp949((char *) pti))
		{
			index = boundless_binary_index_search16(cp949_to_unicode_keys, sizeof(cp949_to_unicode_keys) / sizeof(unsigned short), (unsigned short) pti[0] * 256 + pti[1]);

			if (index >= 0)
			{
				val = cp949_to_unicode_vals[index];

				if (val < 128)
				{
					*pto++ = val;
				}
				else if (val < 4096)
				{
					*pto++ = 192 + val / 64;
					*pto++ = 128 + val % 64;
				}
				else
				{
					*pto++ = 224 + val / 4096;
					*pto++ = 128 + val / 64 % 64;
					*pto++ = 128 + val % 64;
				}
				pti += 2;
			}
			else
			{
//				tintin_printf(gtd->ses, "<118>cp949_to_utf8: did not find cp949 index '0x%02x%02x'", pti[0], pti[1]);
				*pto++ = '?';
				*pto++ = '?';
				pti += 2;
			}
		}
		else
		{
			*pto++ = *pti++;
		}
	}
	*pto = 0;

	return pto - (unsigned char *) output;
}
